import styled from 'styled-components'

export const Listavideo = styled.div`
    background-color: #FB9FAF;
    padding:10px;
    margin-left:20px;
    margin-right: 10px;
    width:35%;
`;

export const Item = styled.div`
    background-color:#F7F7F7;
    display:flex;
    align-items:center;
    margin-bottom: 10px;
    div{
        padding:10px;
        h2{
            font-size:14px;
        }
    }
`;

export const Itemteste =styled.div`
background-color:#FB9FAF;
padding:10px;
margin-left:20px;
margin-right: 10px;
width:35%;
`;
